import React from "react";

export default function Activate() {
  return (
    <main className="section-container">
      <h1 className="section-title">How to Activate Your License</h1>
      <p className="lead">
        Activate your license with ARAD in three simple steps—no MLS required. We handle DocuSign
        paperwork and guide you through state requirements so you can start earning quickly.
      </p>
      <ol>
        <li><b>Complete digital forms:</b> ARAD agreement + state paperwork (DocuSign).</li>
        <li><b>Submit/verify license:</b> We confirm details and process your activation.</li>
        <li><b>Go live:</b> Your license is active under ARAD—you’re ready to earn.</li>
      </ol>
    </main>
  );
}
